[{"location":"api/#Kang-api","page":"Kang api","title":"Kang api","text":"","category":"section"},{"location":"api/#Raytracing-Functions","page":"Kang api","title":"Raytracing Functions","text":"","category":"section"},{"location":"api/","page":"Kang api","title":"Kang api","text":"Modules = [Kang]","category":"page"},{"location":"api/#Kang.AbstractMetric","page":"Kang api","title":"Kang.AbstractMetric","text":"abstract type AbstractMetric\n\nAbstract Metric Type\n\n\n\n\n\n","category":"type"},{"location":"api/#Kang.Kerr","page":"Kang api","title":"Kang.Kerr","text":"Kerr Metric in Boyer Lindquist Coordinates\n\n\n\n\n\n","category":"type"},{"location":"api/#Kang.Gθ-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Vararg{Any, 6}}} where T","page":"Kang api","title":"Kang.Gθ","text":"Gθ(metric::Kerr{T}, α, β, θs, θo, isindir, n) where T\n\nReturns the antiderivative G_theta=intfracdthetasqrtTheta(theta)\n\nmetric: Kerr{T} metric\n\nα : Horizontal Bardeen screen coordinate\n\nβ : Vertical Bardeen screen coordinate\n\nθs : Emission inclination\n\nθo : Observer inclination\n\nisindir : Is the path direct or indirect?\n\nn : nth image ordered by minotime\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.Ir-Tuple{Kang.Kerr, Bool, Vararg{Any, 4}}","page":"Kang api","title":"Kang.Ir","text":"Ir(metric::Kerr{T}, νr::Bool, θo, rs, α, β) where T\n\nReturns the antiderivative I_r=intfracdrsqrtmathcalR(r)\n\nmetric: Kerr{T} metric\n\nνr : Radial velocity direction at emission\n\nθo : Observer inclination\n\nα  : Horizontal Bardeen screen coordinate\n\nβ  : Vertical Bardeen screen coordinate\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang._isreal2-Tuple{Any, Any}","page":"Kang api","title":"Kang._isreal2","text":"_isreal2(num, T)\n\nChecks if a complex number is real to within machine precision\n\n`num`: Complex number\n\n`T`  : Type of number\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.emission_coordinates-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Vararg{Any, 6}}} where T","page":"Kang api","title":"Kang.emission_coordinates","text":"emission_coordinates(metric::Kerr{T}, α, β, θs, θo, isindir, n) where T\n\nEmission radius and azimuthal angle for point originating at inclination θs whose nth order image appears at the screen coordinate (α, β)  for an observer located at inclination θo.\n\nmetric : Kerr{T} metric\n\nα : Horizontal Bardeen Screen Coordinates\n\nβ : Vertical Bardeen Screen Coordinates\n\nθs : Emission Inclination\n\nθo : Observer Inclination\n\nisindir : Whether emission to observer is direct or indirect\n\nn : Image index\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.emission_coordinates_fast_light-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Vararg{Any, 6}}} where T","page":"Kang api","title":"Kang.emission_coordinates_fast_light","text":"emissioncoordinatesfast_light(metric::Kerr{T}, α, β, θs, θo, isindir, n) where T\n\nEmission radius and azimuthal angle for point originating at inclination θs whose nth order image appears at the screen coordinate (α, β)  for an observer located at inclination θo.\n\nmetric : Kerr{T} metric\n\nα : Horizontal Bardeen Screen Coordinates\n\nβ : Vertical Bardeen Screen Coordinates\n\nθs : Emission Inclination\n\nθo : Observer Inclination\n\nisindir : Whether emission to observer is direct or indirect\n\nn : Image index\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.emission_inclination-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Vararg{Any, 4}}} where T","page":"Kang api","title":"Kang.emission_inclination","text":"emission_inclination(metric::Kerr{T}, α, β, θo, τ) where T\n\nEmission inclination for point that appears at the screen coordinate (α, β) for an observer located at inclination θo that is connected by a ray with mino time τ.\n\nmetric : Kerr{T} metric\n\nα : Horizontal Bardeen Screen Coordinates\n\nβ : Vertical Bardeen Screen Coordinates\n\nθo : Observer Inclination\n\nτ : Mino Time\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.emission_radius-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Vararg{Any, 6}}} where T","page":"Kang api","title":"Kang.emission_radius","text":"emission_radius(metric::Kerr{T}, α, β, θs, θo, isindir, n) where T\n\nEmission radius for point originating at inclination θs whose nth order image appears at the screen coordinate (α, β)  for an observer located at inclination θo.\n\nmetric : Kerr{T} metric\n\nα : Horizontal Bardeen screen coordinate\n\nβ : Vertical Bardeen screen coordinate\n\nθs : Emission inclination\n\nθo : Observer inclination\n\nisindir : Normalized angular momentum\n\nn : Image index\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.get_radial_roots-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Any, Any}} where T","page":"Kang api","title":"Kang.get_radial_roots","text":"getradialroots(metric::Kerr{T}, η, λ) where T\n\nReturns roots of r^4 + (a^2-η-λ^2)r^2 + 2(η+(a-λ)^2)r - a^2η\n\nmetric: Kerr{T} metric\n\nη  : Reduced Carter constant\n\nλ  : Reduced azimuthal agular momentum\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.horizon-Union{Tuple{Kang.Kerr{T}}, Tuple{T}} where T","page":"Kang api","title":"Kang.horizon","text":"horizon(metric::Kerr{T})\n\nParams\n\nmetric : Kerr{T} metric\n\nOuter Horizon for the Kerr{T} metric.\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.metric_dd-Tuple{Kang.AbstractMetric, Vararg{Any}}","page":"Kang api","title":"Kang.metric_dd","text":"metric_dd(metric::AbstractMetric, args)\n\nReturns the metric in some representation (usually as an nxn matrix).\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.metric_dd-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Any, Any}} where T","page":"Kang api","title":"Kang.metric_dd","text":"metric_dd(metric::Kerr{T}, r, θ)\n\nParams\n\nmetric : Kerr{T} metric\n\nr : Radius\n\nθ : Inclination \n\nInverse Kerr{T} metric in Boyer Lindquist (BL) coordinates.\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.metric_dd-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Any}} where T","page":"Kang api","title":"Kang.metric_dd","text":"metric_dd(metric::Kerr{T}, coordinates)\n\nParams\n\nmetric : Kerr{T} metric\n\ncoordinates : Coordinates (t, r, θ, ϕ)\n\nKerr{T} metric in Boyer Lindquist (BL) coordinates.\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.metric_uu-Tuple{Kang.AbstractMetric, Vararg{Any}}","page":"Kang api","title":"Kang.metric_uu","text":"metric_uu(metric::AbstractMetric, args)\n\nReturns the inverse metric in some representation (usually as an nxn matrix).\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.metric_uu-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Any, Any}} where T","page":"Kang api","title":"Kang.metric_uu","text":"metric_uu(metric::Kerr{T}, r, θ)\n\nParams\n\nmetric : Kerr{T} metric\n\nr : Radius\n\nθ : Inclination \n\nInverse Kerr{T} metric in Boyer Lindquist (BL) coordinates.\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.metric_uu-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Any}} where T","page":"Kang api","title":"Kang.metric_uu","text":"metric_uu(metric::Kerr{T}, coordinates)\n\nParams\n\nmetric : Kerr{T} metric\n\ncoordinates : Coordinates (t, r, θ, ϕ)\n\nInverse Kerr{T} metric in Boyer Lindquist (BL) coordinates.\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.mino_time-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Vararg{Any, 6}}} where T","page":"Kang api","title":"Kang.mino_time","text":"mino_time(η, λ, a, θs, θo, isindir::Bool, n::Int64)\n\nMino time of trajectory between two inclinations for a given screen coordinate\n\nα : Horizontal Bardeen screen coordinate\n\nβ : Vertical Bardeen screen coordinate \n\na : Blackhole angular Momentum\n\nθs : Emission inclination\n\nθo : Observer inclination\n\nisindir : Is the path direct or indirect?\n\nn : nth image in orde of amount of minotime traversed\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.r_potential-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Any, Any, Any}} where T","page":"Kang api","title":"Kang.r_potential","text":"r_potential(metric::Kerr{T}, r, η, λ) where T\n\nRadial potential of spacetime\n\n`metric`: Kerr{T} metric\n\n`η`  : Reduced Carter constant\n\n`λ`  : Reduced azimuthal agular momentum\n\n`r`  : Boyer Lindquist radius\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.radial_integrals_case2-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Any, NTuple{4, T} where T, Any, Any}} where T","page":"Kang api","title":"Kang.radial_integrals_case2","text":"radial_integrals_case2(metric::Kerr{T}, rs, roots::NTuple{4}, τ, νr)\n\nReturns the radial integrals for the case where there are four real roots in the radial potential, with roots outside the horizon.\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.radial_integrals_case3-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Any, NTuple{4, T} where T, Any}} where T","page":"Kang api","title":"Kang.radial_integrals_case3","text":"radial_integrals_case3(metric::Kerr{T}, rs, roots::NTuple{4}, τ) where {T}\n\nReturns the radial integrals for the case where there are two real roots in the radial potential\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.radial_integrals_case4-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Any, NTuple{4, T} where T, Any}} where T","page":"Kang api","title":"Kang.radial_integrals_case4","text":"radial_integrals_case4(metric::Kerr{T}, rs, roots::NTuple{4}, τ)\n\nReturns the radial integrals for the case where there are no real roots in the radial potential\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.regularized_Pi-Tuple{Any, Any, Any}","page":"Kang api","title":"Kang.regularized_Pi","text":"regularized_Pi(n, ϕ, k)\n\nRegularized elliptic integral of the third kind\n\n    `n`: Parameter\n\n    `ϕ`: Argument\n\n    `k`: Parameter\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.α-Tuple{Kang.Kerr, Any, Any}","page":"Kang api","title":"Kang.α","text":"α(metric::Kerr{T}, α, θo) where T\n\nHorizontal Bardeen Screen Coordinate \tmetric: Kerr\n\n`α`: Horizontal Bardeen screen coordinate\n\n`θo`: Observer inclination\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.αboundary-Tuple{Kang.Kerr, Any}","page":"Kang api","title":"Kang.αboundary","text":"αboundary(metric::Kerr, θs) where\n\nDefines a horizontal boundary on the assmyptotic observers screen where emission that originates from θs must fall within.\n\n`metric`: Kerr metric\n\n`θs`  : Emission Inclination\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.β-Tuple{Kang.Kerr, Any, Any, Any}","page":"Kang api","title":"Kang.β","text":"β(metric::Kerr, λ, η, θo)\n\nHorizontal Bardeen Screen Coordinate \tmetric: Kerr\n\n`λ`: Energy reduced Azimuthal angular momentul\n\n`η`: Energy reduced Carter integral \n\n`θo`: Observer inclination\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.βboundary-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Any, Any, Any}} where T","page":"Kang api","title":"Kang.βboundary","text":"βboundary(metric::Kerr{T}, α, θo, θs) where {T}\n\nDefines a vertical boundary on the Assyptotic observers screen where emission that originates from θs must fall within.\n\n`metric`: Kerr{T} metric\n\n`α`   : Horizontal Bardeen screen coordinate\n\n`θo`  : Observer inclination\n\n`θs`  : Emission Inclination\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.η-Tuple{Kang.Kerr, Any, Any, Any}","page":"Kang api","title":"Kang.η","text":"η(metric::Kerr{T}, α, β, θo) where T\n\nEnergy reduced Carter integral \tmetric: Kerr\n\n`α`: Horizontal Bardeen screen coordinate\n\n`β`: Bardeen vertical coordinate\n\n`θo`: Observer inclination\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.θ_potential-Union{Tuple{T}, Tuple{Kang.Kerr{T}, Any, Any, Any}} where T","page":"Kang api","title":"Kang.θ_potential","text":"θ_potential(metric::Kerr{T}, r, η, λ) where T\n\nTheta potential of a kerr blackhole\n\n`metric`: Kerr{T} metric\n\n`η`  : Reduced Carter constant\n\n`λ`  : Reduced azimuthal agular momentum\n\n`θ`  : Boyer Lindquist inclination\n\n\n\n\n\n","category":"method"},{"location":"api/#Kang.λ-Tuple{Kang.Kerr, Any, Any}","page":"Kang api","title":"Kang.λ","text":"λ(metric::Kerr{T}, α, θo) where T\n\nEnergy reduced azimuthal angular momentum \tmetric: Kerr\n\n`α`: Horizontal Bardeen screen coordinate\n\n`θo`: Observer inclination\n\n\n\n\n\n","category":"method"},{"location":"kerr_geodesic_summary/#The-Geodesics-of-the-Kerr-Metric","page":"Theory","title":"The Geodesics of the Kerr Metric","text":"","category":"section"},{"location":"kerr_geodesic_summary/#Geodesic-Equations","page":"Theory","title":"Geodesic Equations","text":"","category":"section"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"Geodesics are extremal solutions to the local optimization problem of the action:","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"beginequation\nS = int_tildetau_i^tildetau_f dtildetausqrt-g_munudot x^mu dot x^nu\nendequation","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"defined on a manifold with metric g_munu, which in the case of the Kerr, can be written in Boyer-Lindquist coordinates[BL] as:","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"beginequation\ng_munu=left(\nbeginarraycccc\n fracr_s rSigma -1  0  0  -fraca^2 sin ^2(theta ) r_s rSigma  \n 0  fracSigma Delta   0  0 \n 0  0  Sigma   0 \n -fraca^2 r sin ^2(theta ) r_sSigma   0  0  sin ^2(theta ) left(fraca^2\n   sin ^2(theta ) r_s rSigma +a^2+r^2right) \nendarray\nright)\nendequation","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"where Sigma = r^2 +a^2cos(theta)^2 and Delta=r^2- r_s r+a^2.  In general, geodesics are constrained to satisfy the geodesic equations,","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"beginequation\nfracd^2x^mudtildetau^2 =-Gamma^mu_alphabetadot x^alpha dot x^beta\nendequation","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"where,","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"beginequation\nGamma^mu_alphabeta = frac12g^munu(g_alphanu beta + g_betanu alpha - g_alphabeta nu)\nendequation","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"are the Christoffel symbols.","category":"page"},{"location":"kerr_geodesic_summary/#Hamilton-Jacobi-Equations","page":"Theory","title":"Hamilton-Jacobi Equations","text":"","category":"section"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"The Kerr family of metrics belongs to the class of type-D (type-{2,2}) spacetimes. These spacetimes admit a Killing-Yano tensor [PW] from which it is possible to define a Carter constant and Penrose-Walker constant.  The Carter constant, in particular, allows solutions of the geodesic equations to be expressed in terms of quadratures through the Hamilton-Jacobi approach[Carter], whose equations are given by:","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"beginalign\nH\n    =frac12g^munup_mup_nu\nK\n    =fracpartial Spartial tildetau + Hleft(x fracpartial Spartial x tildetauright)=0\np_mu\n    =fracpartial Spartial x^mu\nendalign","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"The Carter constant is useful since it lets the Hamilton-Jacobi equations be seperable, resulting in a Hamiltonian principle function that takes the form,","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"beginequation\nS =  int fracsqrtmathcal RDeltadr + intsqrtTheta dtheta-Et +Lphi+ frac12kappatildetau\nendequation","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"where kappa is the conserved four momentum magnitude, E is the conserved energy, L is the conserved azimuthal angular momentum, and","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"beginalign\nmathcal R\n    =Delta-C+kappa r - (L-aE)^2+E(r^2+a^2)-La^2\nTheta\n    =C+cos^2thetaleft((kappa+E^2)a^2-fracL^2sin^2thetaright)\nendalign","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"are the radial and inclination potentials that depend on the previously mentioned conserved quantities along with the Carter constant C.","category":"page"},{"location":"kerr_geodesic_summary/#Integral-solutions","page":"Theory","title":"Integral solutions","text":"","category":"section"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"A noteworthy fact is that null geodesics, kappa=0, only depend on the reduced Carter constant and angular momentum","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"beginalign\n    lambda\n        =fracLE\n    eta\n        =fracCE^2\nendalign","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"We use this freedom to fix E=1 and write the  radial and inclination potentials for null geodesics as,","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"beginalign\nmathcal R\n    =-Deltaeta + (lambda-a)^2+(r^2+a^2)-lambda a^2\nTheta\n    =eta+cos^2thetaleft(a^2-fraclambda^2sin^2thetaright)\nendalign","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"The Hamilton-Jacobi Equations then reduce to four first order differential equations: ","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"beginalign\nfracSigmaEdot r\n    = sqrtmathcal R\nfracSigmaEdot theta\n    = sqrtTheta\nfracSigmaEdot phi\n    = fracaDelta(r^2+a^2-alambda)+fraclambdasin^2theta-a\nfracSigmaEdot t\n    = fracr^2+a^2Delta(r^2+a^2-alambda)+a(lambda-asin^2theta)\n\nendalign","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"a fact which follows from the relationship, dot x^mu=p^mu=g^munupartial_nu S. Equations (15)-(18) define a 'Kepler-like' problem where a new parameter, known as the Mino time tau, is defined in terms of an integral in r or theta, and acts similar to the Keplerian coordinate time in that problem. The Mino time is defined by its relationship to the affine parameter by dtau=dtildetauSigma. Furthermore, Equations (15) and (16) imply that the Mino time can be written as a function of r or theta through the relationships,","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"beginalign\ntau=tau_r(r_fr_i)\n    =ointsqrtRdrtext and\ntau=tau_theta(theta_ftheta_i)\n    =ointsqrtThetadtheta\nendalign","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"These equations are useful since tau_theta and tau_r can be inverted to write,","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"beginalign\ntheta_i\n    =tau_theta^-1(tautheta_f)\nr_i\n    =tau_r^-1(taur_f)\n\nendalign","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"Thus for a given t_f r_f theta_f phi_f lambda and eta, one can choose to parameterize the solutions of equations (15)-(18) by either Deltataur_i or theta_i.","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"More details on this formalism and the solutions can be found in this review artivle by Gralla & Lupsasca[GL]","category":"page"},{"location":"kerr_geodesic_summary/#Linear-Polarization","page":"Theory","title":"Linear-Polarization","text":"","category":"section"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"The existence of the Penrose-Walker constant makes linear polarization directly derivable from a conserved quantity in Kerr spacetimes.","category":"page"},{"location":"kerr_geodesic_summary/#References","page":"Theory","title":"References","text":"","category":"section"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"[PW]: Walker, M., Penrose, R. On quadratic first integrals of the geodesic equations for type {22} spacetimes. Commun.Math. Phys. 18, 265–274 (1970).","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"[Carter]: Brandon Carter Phys. Rev. 174, 1559 – Published 25 October 1968","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"[BL]: Robert H. Boyer, Richard W. Lindquist; Maximal Analytic Extension of the Kerr Metric. J. Math. Phys. 1 February 1967; 8 (2): 265–281.","category":"page"},{"location":"kerr_geodesic_summary/","page":"Theory","title":"Theory","text":"[GL]: Samuel E. Gralla and Alexandru LupsascaPhys. Rev. D 101, 044032","category":"page"},{"location":"","page":"Home","title":"Home","text":"CurrentModule = Kang","category":"page"},{"location":"#Kang","page":"Home","title":"Kang","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for Kang.","category":"page"},{"location":"#Pages","page":"Home","title":"Pages","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Pages = [\n    \"kerr_geodesics_summary.md\",\n    \"api.md\",\n    ]","category":"page"}]
